<!doctype html>
<html>
	<head>
		<title>Inkscape Output</title>
	</head>
	<body>
		<canvas id="canvas" width="100" height="100"></canvas>
		<script>
			var ctx = document.getElementById("canvas").getContext("2d");

			// #layer1

			// #path5-3
			ctx.beginPath();
			ctx.strokeStyle = "rgb(0, 0, 0)";
			ctx.lineWidth = 1.04444;
			ctx.lineCap = "butt";
			ctx.lineJoin = "miter";
			ctx.moveTo(65.000081, 49.409785);
			ctx.lineTo(4.999097, 49.499922);
			ctx.stroke();

			// #path1
			ctx.beginPath();
			ctx.strokeStyle = "rgb(0, 0, 0)";
			ctx.lineWidth = 1.0;
			ctx.lineCap = "butt";
			ctx.lineJoin = "miter";
			ctx.moveTo(65.0, 35.0);
			ctx.lineTo(95.0, 50.0);
			ctx.lineTo(65.0, 65.0);
			ctx.closePath();
			ctx.stroke();
		</script>
	</body>
</html>
